import React, {Component} from 'react'

import '../checkbox.css'

class Checkbox extends Component {
    constructor(props){
        super(props)
        this.props.bind(this.props.onCheck)
    }
    render(){
        return (
            <span onClick={this.props.toggleCheck} onChange={this.props.onCheck}>
                <input type="checkbox" checked={this.props.isChecked} onChange={this.props.onCheck}></input>
                <span></span>
            </span>
        )
    }
}

export default Checkbox
